	[16201] = [[{16201, "随机觉醒符石", 16201, 100, 2, 5, 9999, 1, 4, 0, {}, {}, {}, {{124,0}}, "蕴含觉醒力量的神秘符石，使用后随机获得一种<div fontcolor=#9e501b>13星专属职业技能符石</div>", 1, 0, 2, {1}, 1, 0, 0, {2}, "技能道具", "作用：物品获取", 1, 0}]],
	[16108] = [[{16108, "急救符石", 16108, 0, 2, 5, 9999, 1, 1, 0, {{10460,3}}, {}, {}, {{114,0},{124,0}}, "<div fontcolor=#9e501b>救急:</div>使用治疗主动技能时，对生命低于20%的友方，使其额外受到20%（固定值）*自身已损失生命占比的治疗效果\n可使英雄<div fontcolor=#9e501b>领悟</div>或<div fontcolor=#9e501b>升级</div><div fontcolor=#9e501b>「救急」</div>觉醒天赋，英雄将在<div fontcolor=#9e501b>13星</div>开启觉醒", 1, 0, 2, {}, 1, 0, 0, {37,6,1}, "技能道具", "作用：觉醒天赋学习", 1, 0}]],
	[16107] = [[{16107, "灵感符石", 16107, 0, 2, 5, 9999, 1, 1, 0, {{10460,3}}, {}, {}, {{114,0},{124,0}}, "<div fontcolor=#9e501b>灵感:</div>使用增益主动技能时，有20%概率使增益持续回合+1，该效果冷却2回合；使用减益技能时，效果触发率+5%\n可使英雄<div fontcolor=#9e501b>领悟</div>或<div fontcolor=#9e501b>升级</div><div fontcolor=#9e501b>「灵感」</div>觉醒天赋，英雄将在<div fontcolor=#9e501b>13星</div>开启觉醒", 1, 0, 2, {}, 1, 0, 0, {37,6,1}, "技能道具", "作用：觉醒天赋学习", 1, 0}]],
	[16106] = [[{16106, "庇护符石", 16106, 0, 2, 5, 9999, 1, 1, 0, {{10460,3}}, {}, {}, {{114,0},{124,0}}, "<div fontcolor=#9e501b>庇护:</div>队友受到致命伤害死亡后，输送自身10%生命对其庇护，自身气血低于40%不会触发，冷却4回合。\n可使英雄<div fontcolor=#9e501b>领悟</div>或<div fontcolor=#9e501b>升级</div><div fontcolor=#9e501b>「庇护」</div>觉醒天赋，英雄将在<div fontcolor=#9e501b>13星</div>开启觉醒", 1, 0, 2, {}, 1, 0, 0, {37,6,1}, "技能道具", "作用：觉醒天赋学习", 1, 0}]],
	[16105] = [[{16105, "信仰符石", 16105, 0, 2, 5, 9999, 1, 1, 0, {{10460,3}}, {}, {}, {{114,0},{124,0}}, "<div fontcolor=#9e501b>信仰:</div>自身生命在50%及以上时，受到的物理伤害降低5%；50%以下时，受到治疗增加10%\n可使英雄<div fontcolor=#9e501b>领悟</div>或<div fontcolor=#9e501b>升级</div><div fontcolor=#9e501b>「信仰」</div>觉醒天赋，英雄将在<div fontcolor=#9e501b>13星</div>开启觉醒", 1, 0, 2, {}, 1, 0, 0, {37,6,1}, "技能道具", "作用：觉醒天赋学习", 1, 0}]],
	[16104] = [[{16104, "制裁符石", 16104, 0, 2, 5, 9999, 1, 1, 0, {{10460,3}}, {}, {}, {{114,0},{124,0}}, "<div fontcolor=#9e501b>制裁:</div>攻击时使目标额外受到其生命上限*3%的伤害值（不超过本次所受技能伤害值的30%）\n可使英雄<div fontcolor=#9e501b>领悟</div>或<div fontcolor=#9e501b>升级</div><div fontcolor=#9e501b>「制裁」</div>觉醒天赋，英雄将在<div fontcolor=#9e501b>13星</div>开启觉醒", 1, 0, 2, {}, 1, 0, 0, {37,6,1}, "技能道具", "作用：觉醒天赋学习", 1, 0}]],
	[16103] = [[{16103, "灵巧符石", 16103, 0, 2, 5, 9999, 1, 1, 0, {{10460,3}}, {}, {}, {{114,0},{124,0}}, "<div fontcolor=#9e501b>灵巧:</div>无视所有减速效果；每回合开始，每存在1位同系友方英雄，自身速度依次提高3%/6%/9%/11%（无法与【迅捷】共存，优先生效）\n可使英雄<div fontcolor=#9e501b>领悟</div>或<div fontcolor=#9e501b>升级</div><div fontcolor=#9e501b>「灵巧」</div>觉醒天赋，英雄将在<div fontcolor=#9e501b>13星</div>开启觉醒", 1, 0, 2, {}, 1, 0, 0, {37,6,1}, "技能道具", "作用：觉醒天赋学习", 1, 0}]],
	[16102] = [[{16102, "蓄力符石", 16102, 0, 2, 5, 9999, 1, 1, 0, {{10460,3}}, {}, {}, {{114,0},{124,0}}, "<div fontcolor=#9e501b>蓄力:</div>本回合无法行动时，下次释放攻击技能时伤害额外提高15%（可叠加，无法被驱散，每次释放攻击技能后移除）\n可使英雄<div fontcolor=#9e501b>领悟</div>或<div fontcolor=#9e501b>升级</div><div fontcolor=#9e501b>「蓄力」</div>觉醒天赋，英雄将在<div fontcolor=#9e501b>13星</div>开启觉醒", 1, 0, 2, {}, 1, 0, 0, {37,6,1}, "技能道具", "作用：觉醒天赋学习", 1, 0}]],
	[16101] = [[{16101, "破裂符石", 16101, 0, 2, 5, 9999, 1, 1, 0, {{10460,3}}, {}, {}, {{114,0},{124,0}}, "<div fontcolor=#9e501b>破裂:</div>对带有【护盾】的敌人额外造成5%的伤害，且造成伤害值的30%将直接无视护盾效果\n可使英雄<div fontcolor=#9e501b>领悟</div>或<div fontcolor=#9e501b>升级</div><div fontcolor=#9e501b>「破裂」</div>觉醒天赋，英雄将在<div fontcolor=#9e501b>13星</div>开启觉醒", 1, 0, 2, {}, 1, 0, 0, {37,6,1}, "技能道具", "作用：技能学习", 1, 0}]],
